import React, { Component } from 'react'
import Context from "../context"
export class send extends Component {
  render() {
    return (
       < Context.Consumer>
        <div class="header">
      <div className="se"><p> تم أرسال طلبك بنجاح</p>
       </div>
      </div>
      </ Context.Consumer>
    )
  }
}

export default send
